import React from "react";
import { ExpenseItem } from "./ExpenseItem";
import './ExpensesList.css';

export function ExpensesList(props) {
    if (props.items.length === 0) {
        return <h2 className="empty-expenses-list">There are no expenses.</h2>;
    }

  return <ul>{props.items.map((expense) => (
        <ExpenseItem
          key={expense.id}
          title={expense.title}
          amount={expense.amount}
          date={expense.date}
        />
      ))}</ul>
}
